import adapter from './adapter'


let listOfStreams = adapter.getStreams()
.then(streamsList => streamsList)

let streams = [];

const data = {
//game
createGame: () => {
  return fetch(`${URL}/games`, {
      method: 'POST',
      headers: { "Content-Type": "application/json" },
    })
    .then(res => res.json()) 
  },
}


export default data;
